import React from "react";
import SideBar from "./menu.js";
import "./menu.css";
import logo from "./logo.png";
import Dropdown from "./Dropdown";
const Head = {
  height: "70px"
};
const imgStyle = {
  padding: "15px",
  marginLeft: "35px"
};
const LangStyle = {
  position: "absolute",
  right: "20px",
  top: "20px",

  color: "#56c0d0"
};
function Header() {
  return (
    <div id="App" className="App">
      <header id="hd" className=" header indexheader" style={Head}>
        <div>
          <SideBar pageWrapId={"hd"} outerContainerId={"App"} />{" "}
          <img src={logo} alt="logo" style={imgStyle} />
          <a href="/" style={LangStyle}>
            Languages <i class="fas fa-caret-down" />
          </a>
          <Dropdown />
        </div>
      </header>
    </div>
  );
}

export default Header;
